import React from 'react';
import { useNavigate } from 'react-router-dom';

import Header from '../components/Header/Header';
function ItemPage() {
  const navigate = useNavigate();

  // Локальні дані про товар
  const item = {
    title: 'Some awesome title',
    description: 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nunc maximus, nulla ut commodo sagittis, sapien dui mattis dui, non pulvinar lorem felis nec erat.',
    price: 45.00,
    characteristics: ['1 characteristic', '2 characteristic'],
    image: 'example-image.jpg', // Додайте зображення в папку assets/images
  };

  return (
    <div className="item-page">
      <Header/>
      {/* Основний контент */}
      <div className="item-content">
        {/* Зображення товару */}
        <img src={require(require(`../../../assets/images/${image}`))} alt={item.title} className="item-image" />

        <div className="item-details">
          {/* Характеристики */}
          <div className="characteristics">
            {item.characteristics.map((characteristic, index) => (
              <span key={index} className="characteristic-badge">{characteristic}</span>
            ))}
          </div>

          {/* Назва товару */}
          <h2 className="item-title">{item.title}</h2>
          <p className="item-description">{item.description}</p>

          {/* Поля для вибору параметрів */}
          <div className="item-options">
            <div className="countable-field">
              <label>Countable field</label>
              <input type="number" defaultValue="1" min="1" />
            </div>

            <div className="selectable-field">
              <label>Selectable Field</label>
              <select>
                <option value="">Select</option>
                <option value="option1">Option 1</option>
                <option value="option2">Option 2</option>
              </select>
            </div>
          </div>

          {/* Ціна товару */}
          <p className="item-price">Price: ${item.price.toFixed(2)}</p>

          {/* Кнопки дій */}
          <div className="action-buttons">
            <button onClick={() => navigate(-1)} className="back-button">Go back</button>
            <button onClick={() => console.log('Added to cart')} className="add-to-cart-button">Add to cart</button>
          </div>
        </div>
      </div>

      {/* Нижній колонтитул */}
      <footer className="footer">
        <div className="branding">
          <p>Branding stuff</p>
          <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nunc maximus, nulla ut commodo.</p>
        </div>
        <div className="social-links">
          <a href="#"><img src="path_to_logo_facebook.png" alt="Facebook" /></a>
          <a href="#"><img src="path_to_logo_twitter.png" alt="Twitter" /></a>
          <a href="#"><img src="path_to_logo_linkedin.png" alt="LinkedIn" /></a>
          <a href="#"><img src="path_to_logo_google.png" alt="Google" /></a>
        </div>
      </footer>
    </div>
  );
}

export default ItemPage;
